          <Route path={'/user'} element={<div>User</div>}></Route>
          <Route path={'/etc'} element={<div>etc</div>}></Route>
          <Route path={'/salir'} element={<div>salir</div>}></Route>
      </Routes>
    </div>
  )
}

export default App;
